import React from 'react';

const CommentCard = (comment) => {
  console.log(comment)
  return (
    <div>
      <li>
      <h3>
          {comment.title}
        </h3>
        <h4>
          by:{comment.author}
          <br/>
          in: {comment.topic}
        </h4>
        <h5>
          published at: {comment.created_at}
        </h5>

      </li>
    </div>
  );
};

export default CommentCard;
